content:
작가님 그거 아시나요?
모르실거야...
수많은 웹툰 중 유일하게 결제하고 미리보기하는 작품이라는걸...흥흥&hearts;

작가님 푹 쉬시고 빨리 돌아오세요
(묘한 자기모순..) 김선생님과 남스카이
보고시포요&#x27;♡&#x27;

좋은 200원이었읍니다
후회는 없읍니다 ;ㅁ;
뽑♡뽀

글고 간만에 남스카이 출연이라 반갑 &#x27;~&#x27;
지그시 바라보는 김샘도 귀엽고
사건 해결되면 알콩달콩 하겠네여♡

우리학교 김선생님 114화는 나경원씨와 김재호씨 그리고 그 아들 놈이 꼭 좀 봤으면 하는 추천이다.
&quot;잘못을 하면 벌을 받는다.&quot;
씁씁할게도 현실에서는 검찰에서 무혐의 불기소 처리가 되었다......
&quot;잘못을 해도 부모 잘 만나면 처벌 받지 않는다.&quot;
이걸 나경원과 김재호 그리고 그 아들놈이 배워버렸다.
&quot;잘못을 해도 사회적 지위든 권력이든 약하면 처벌 받는다.&quot;
조국 전 법무부 장관과 정경심 교수님 그리고 그 따님과 아드님은 이것을 뼈 아프게 느끼고 있을 터...
말단 학교에서도 실현되지 않는 정의는 법원에서 실현되지 않았다.

아니 진짜 이정도면 느린거 아니에요;
고구마 좀만 길어도 작가님 사이다좀 이러는 사람들이 여기 다 모여있네;
여긴 전개 느리다고 하는거지 다를게 없잖슴;,
제발 작작 하세요,.. 그러다가 웹툰 망하는거 한두번 봐요??;; 이거 무료로 풀어주는거 자체가 감사해야할 일이고, 먼저 보려고 결제했으면서 계속..;; 요즘에 웹툰 다 너무 내용 뻔해져서 원래 80개 보던거 40개밖에 안봄..,; 악당은 늘 나쁘기만 하고 주인공은 착하거나 셈. 반전이 없음..;; 로판도 조금 보고있으면 다음 내용 다 예측됄정도야 얘들아;,.. 제발 사이다 사이다.. 분량 분량.. 진짜 제발 그만 좀 해,,,..

제프리얘기좀 작작하지 스토리를 읽지 않고 제프리만 보는것같네
적당하면 웃어 넘기지만 이건 뭐;
보통 이런 만화 볼 땐 댓글로 궁예하는거 보는 맛에 같이 보는데 대체 어쩜 이리....새나라의 꼬꼬마들 뿐인건지 맥락없는 캐릭터 찬양뿐이니 것참

그렇구나 과거편에 공들이셨던건. 엄청난 떡밥이네요. 
재앙이 샬롯에게 마음이있었다면 그 전쟁은 대체 뭐였을지..
그나저나 오늘도 역시 뭐가 주고 객인지 모르는 사람들 많네;

아니ㅋㅋㅋㅋㅋㅋㅋㅋ뭔 제프리가 주인공인가 
이번회차 포함 다른 회차도 다 제프리 얘기뿐이네;; 
엘도가 주인공인 에피소드인거 안보이나?

&#x27;앉아&#x27;
한마디에 다같이 착석.
너무 귀여워옄ㅋㅋㅋㅋㅋㅋ

현 샬롯의 제자가 제프리에게 죽임을 당할뻔한 아이라니. 물론 엘도가 혼내주겠다며 시작한건맞는데..(엘도 때찌!) 
그렇다고 그걸또 확인도안해보고 바로 죽이려하냐..소드마스터니 자기가 잘못휘두르면 황천길가는건 알거아냐;;
샬롯이랑 동갑?(맞나;)이고 강자의 입장에서 그에맞는 대처를 보여줄줄알았는데..

[속보] &quot;대륙 최고 소드마스터 루이스터 대공 , 독자들 마음 주거침입 죄로 잡혀가?&quot;
.............🗣👥

[속보] &quot;제프리 텐 루이스터 독자들의 마음에 불을 질러 방화죄 추가되..&quot;
........👤🗣

+[찌라시] &quot; 눈치스텟 마이너스 -10000
마법사 C모양, 한 남자의 헌신적인 플러팅이제 알아채나?!?!?!&quot;

마법으로 &#x27;촤아아아~&#x27;
마법으로 또 촤아아아~~~~~

